//@ts-nocheck
import React from 'react';
import {Line, LineChart} from 'recharts';
import config from './config/defaultblueprint.json';
const bp=config.chartInfo.TinyLineChartData;


export type tinyLineChartProps = {
  tinyLineChartData:any
}

const TinyLineChart = (props: tinyLineChartProps) => {
  {
    return (
      <LineChart width={350} height={150} data={props?.tinyLineChartData}>
        <Line type="monotone" dataKey="pv" stroke="#8884d8" strokeWidth={2} />
      </LineChart>
    );
  }
}

export default TinyLineChart;
